import React, { useState } from 'react';
import './App.css';
import Todo from './components/todo/todo';
import Context from './context'
import AddTodo from './components/todo/addTodo';

const App = () => {
	const [state, setState] = useState([
		{ id: 1, completed: false, title: 'buy beer' },
		{ id: 2, completed: false, title: 'buy fish' },
		{ id: 3, completed: false, title: 'buy bread' },
	])
	let todos = state

	const onChange = (id) => {
		console.log(id)
	}

	return (
		<Context.Provider >
			<div className={'container'} >
				<h1>React todo list</h1>

				{todos.length ? <Todo todos={todos} onChange={onChange} /> : <p>No todo</p>}

			</div>
		</Context.Provider>
	)
}

export default App;
